import React, { useState } from 'react';
import { demoData } from '../data/demo.js';

const FoodDatabasePage = () => { 
    const [foodItems] = useState(demoData.foodDatabase); 
    return (
        <div className="container mx-auto p-8">
            <div className="bg-white shadow-xl rounded-lg p-8">
                <h2 className="text-4xl font-extrabold text-green-700 mb-6 text-center">Food Database ðŸ¥•</h2>
                <p className="text-lg text-gray-600 text-center mb-8">Browse nutritional information for various food items sourced from the USDA.</p>
                <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
                    {foodItems.map(item => (
                        <div key={item.foodId} className="bg-green-50 p-6 rounded-lg shadow-md border-l-4 border-green-500">
                            <h3 className="text-2xl font-semibold text-green-800 mb-2">{item.name}</h3>
                            <p className="text-sm text-gray-500 mb-4">Source: {item.source}</p>
                            <div className="space-y-1 text-gray-700">
                                <p><strong>Serving:</strong> {item.servingSize.value}{item.servingSize.unit}</p>
                                <p><strong>Calories:</strong> {item.nutrients.calories} kcal</p>
                                <p><strong>Protein:</strong> {item.nutrients.protein}g</p>
                                <p><strong>Carbs:</strong> {item.nutrients.carbohydrates}g</p>
                                <p><strong>Fats:</strong> {item.nutrients.fats}g</p>
                                <p><strong>Fiber:</strong> {item.nutrients.fiber}g</p>
                            </div>
                        </div>
                    ))}
                </div>
            </div>
        </div>
    ); 
};

export default FoodDatabasePage;
